import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import GroupPage from './pages/GroupPage';
import Project from './pages/Project';
import './assets/styles/global.css';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/userID/:userId" element={<GroupPage />} />
        <Route path="/userID/:userId/classes/:classId/projects" element={<GroupPage />} />
        <Route path="/userID/:userId/classes/:classId/projects/:projectId/sprints/:sprintId" element={<Project />} />
        <Route path="/userID/:userId/classes/:classId/projects/:projectId/dashboard" element={<Project />} />
        <Route path="/userID/:userId/classes/:classId/projects/:projectId/introduce" element={<Project />} />
        <Route path="/userID/:userId/classes/:classId/projects/:projectId/my-task" element={<Project />} />
        <Route path="/userID/:userId/classes/:classId/projects/:projectId/roadmap" element={<Project />} />
        <Route path="/userID/:userId/classes/:classId/projects/:projectId/rate" element={<Project />} />
        <Route path="*" element={<div>404 - Page Not Found</div>} />
      </Routes>
    </Router>
  );
}

export default App;
